import React, { useEffect } from "react";

const WineStats = () => {
  const fetchWineData = async () => {
    const result = await fetch("../data.json" + new Date().getTime());
    const data = await result.json();
    console.log(data);
  };

  useEffect(() => {
    fetchWineData();
    console.log("yugyg");
  }, []);
  return <div>wine</div>;
};

export default WineStats;
